package main

import (
	"fmt"
	"encoding/hex"
	"github.com/ethereum/go-ethereum/core/types"
	"github.com/ethereum/go-ethereum/rlp"
)

func main() {
	//data := string("")
	data := string("")
	decoded, _ := hex.DecodeString(data)
	var b types.Header
	rlp.DecodeBytes(decoded,&b)
	fmt.Printf("%x\n", b)
}

